BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "gap-every-five-years" (
	"country"	TEXT,
	"year"	TEXT,
	"lifeExp"	TEXT,
	"pop"	TEXT,
	"gdpPercap"	TEXT
);
CREATE TABLE IF NOT EXISTS "countries" (
	"country"	TEXT,
	"color"	TEXT,
	"continent"	TEXT
);
CREATE INDEX IF NOT EXISTS "index_by_country" ON "gap-every-five-years" (
	"country"
);
COMMIT;
